var intro = true;//display intro
var menu = false;
var menu_select = 0;
var t = 0//timer control
var x = 8 //player x
var y = 16 //player y
var php = 1;//player hp
var ehp = 1;//enemy hp
var px = 20; //player combat x
var py = 100; //player combat y
var ex = 140; //enemy combat x
var ey = 30; //enemy combat y
var atk = -1;//enemy attack
var pattack = true;
var pdmg = 10;//player attack
var eattack = false;
var dmg = 1;//ai damage
var selected = 0;
var overworld = true;
var mana = 5;
var potions = 1;
var gold = 0;
var gold_msg = 0;
var gold_amt = 0;
var power1 = "melee";//bottom option
var power2 = "magic";//middle option
var power3 = "FIVES";//top option
var left = false;
var type = 0;//save who we're fighting/picking up
var type_dirx = 0;
var type_diry = 0;
var msg = true;
var msg_counter = 0;
var m = 0;
var player_party_size = 2;
curr_player = 2;//default player sprite
var enemy_party_size = 1;
var party1hp = 2;
var party1tile = 1;//what image to use
var party2hp = 2;
var party2tile = 2;
var map2 = false;
var mapoffsety = 0;
var mapoffsetx = 0;

function solid(x, y) {
	return fget(mget((Math.floor(x / 8) + mapoffsetx), Math.floor((y / 8) + mapoffsety)), 0);
}
function combat(x, y, dirx, diry) {
	return fget(mget(Math.floor(((x - dirx) / 8) + mapoffsetx), Math.floor((y - diry) / 8) + mapoffsety), 1);
}
function pickup(x, y) {
	return fget(mget((Math.floor(x / 8) + mapoffsetx), Math.floor((y / 8) + mapoffsety)), 2);
}

function change(x, y) {
	return fget(mget(Math.floor((x) / 8), Math.floor((y) / 8)), 3);
}

function TIC() {
	if (overworld == true && msg == false && intro == false) {
		t += 1;
		gold_amt = 0;
		type_dirx = 0;
		type_diry = 0;//reset for next combat
		//pickup potions before moving
		if (btnp(0) && pickup(x, y - 8)) {
			type = mget(Math.floor((x / 8) + mapoffsetx), Math.floor((y - 8) / 8) + mapoffsety);
			if (type == 82) { msg = true; }
			potions += 1; t = 0; mset(Math.floor((x / 8) + mapoffsetx), Math.floor(((y - 8) / 8) + mapoffsety), 32);//up
		}
		if (btnp(1) && pickup(x, y + 8)) {
			type = mget(Math.floor((x / 8) + mapoffsetx), Math.floor((y + 8) / 8) + mapoffsety);
			if (type == 82) { msg = true; }
			potions += 1; t = 0; mset(Math.floor((x / 8) + mapoffsetx), Math.floor(((y + 8) / 8) + mapoffsety), 32);
		}
		if (btnp(2) && pickup(x - 8, y)) {
			type = mget(Math.floor(((x - 8) / 8) + mapoffsety), Math.floor((y) / 8) + mapoffsety);
			if (type == 82) { msg = true; }
			potions += 1; t = 0; mset(Math.floor(((x - 8) / 8) + mapoffsetx), Math.floor((y / 8) + mapoffsety), 32);
		}
		if (btnp(3) && pickup(x + 8, y)) {
			type = mget(Math.floor(((x + 8) / 8) + mapoffsetx), Math.floor((y) / 8) + mapoffsety);
			if (type == 82) { msg = true; }
			potions += 1; t = 0; mset(Math.floor(((x + 8) / 8) + mapoffsetx), Math.floor((y / 8) + mapoffsety), 32);
		}
		/////////////
		if (t > 10) {//artifically hold so we can pickup stuff
			if (btnp(0) && !solid(x, y - 8)) y -= 8//up
			if (btnp(1) && !solid(x, y + 8)) y += 8//down
			if (btnp(2) && !solid(x - 8, y)) { x -= 8; left = true; }//left
			if (btnp(3) && !solid(x + 8, y)) { x += 8; left = false; }//right
		}
		//enter combat
		if (combat(x, y, 0, 8)) {
			ehp = Math.round(Math.random(2)) + 2;//rand enemy hp
			type = mget(Math.floor((x / 8) + mapoffsetx), Math.floor((y - 8) / 8) + mapoffsety);//who we fight
			overworld = false;
			selected = 0;
			type_diry = -8;
			t = 0;
		}
		else if (combat(x, y, 0, -8)) {
			ehp = Math.round(Math.random(2)) + 2;//rand enemy hp
			type = mget((Math.floor(x / 8) + mapoffsetx), Math.floor((y + 8) / 8) + mapoffsety);//who we fight
			overworld = false;
			selected = 0;
			type_diry = 8;
			t = 0;
		}
		else if (combat(x, y, -8, 0)) {
			ehp = Math.round(Math.random(2)) + 2;//rand enemy hp
			type = mget(Math.floor(((x + 8) / 8) + mapoffsetx), Math.floor(y / 8) + mapoffsety);//who we fight
			overworld = false;
			selected = 0;
			type_dirx = 8;
			t = 0;
		}
		else if (combat(x, y, 8, 0)) {
			ehp = Math.round(Math.random(2)) + 2;//rand enemy hp
			type = mget((Math.floor((x - 8) / 8) + mapoffsetx), Math.floor(y / 8) + mapoffsety);//who we fight
			overworld = false;
			selected = 0;
			type_dir = -8;
			t = 0;
		}

	}
	if (overworld == false && msg == false && intro == false) {

		if (btnp(0) && pattack == true) {
			selected += 1;
			if (selected > 2) {
				selected = 0;
			}
		}
		if (btnp(1) && pattack == true) {
			selected -= 1;
			if (selected < 0) {
				selected = 2;
			}
		}
		if (btnp(4) && pattack == true && selected == 0) {
			pattack = false;
			pdmg = 1;
			ehp -= pdmg;
			t = 0;//reset timer
		}
		if (btnp(4) && pattack == true && selected == 1 && mana > 0) {
			pattack = false;
			mana -= 1;
			pdmg = 2;
			ehp -= pdmg;
			t = 0;//reset timer
		}
		if (btnp(4) && pattack == true && selected == 2 && mana > 0) {
			pattack = false;
			if (curr_player == 2) {//this is Life Drain spell
				mana -= 1;
				pdmg = 2;
				php += 1;
				ehp -= pdmg;
			}
			t = 0;//reset timer
		}
		if (btnp(5) && pattack == true) {
			if (potions > 0) {
				potions -= 1;
				pattack = false;
				mana += 5;
				php += 5;
				pdmg = -1;//don't display dmg counter
				t = 0;
			}
		}
		else if (btnp(5) && pattack == false) {
			t += 50;//speed up wait
		}
	}

	if (overworld == false && msg == false && intro == false) {
		cls()
		rectb(ex - 10, ey - 20, 60, 100, 13);
		//draw party size
		var curr = 0;
		while (curr < player_party_size) {
			curr += 1;
			spr(68, px - 20 + (curr * 10), py - 100);//draw party size
		}
		if (type == 1) {//ghost
			spr(6, ex, ey + 4, 7, 3, 0, 0, 2, 2);//spr(1,ex,ey);//enemy sprite
		}
		else if (type == 35) {//skeleton
			spr(4, ex, ey + 4, 7, 3, 0, 0, 2, 2);//spr(1,ex,ey);//enemy sprite
		}
		else if (type == 67) {//witch
			spr(36, ex, ey + 4, 7, 3, 0, 0, 2, 2);//spr(1,ex,ey);//enemy sprite
		}
		else if (type == 51) {//bat
			spr(38, ex, ey + 4, 7, 3, 0, 0, 2, 2);//spr(1,ex,ey);//enemy sprite
		}
		else if (type == 98) {//zombie
			spr(98, ex, ey + 4, 7, 4);//enlarge sprite (we don't have a big zombie yet)
		}
		else if (type == 99) {//devil
			spr(99, ex, ey + 4, 7, 4);//enlarge sprite (we don't have a big devil yet)
		}
		else if (type == 34) {//spider
			spr(34, ex, ey + 4, 7, 4);//enlarge sprite (we don't have a big spider yet)
		}
		else if (type == 50) {//wolf
			spr(50, ex, ey + 4, 7, 4);//enlarge sprite (we don't have a big wolf yet)
		}
		else {
			//placeholder enemy
			spr(6, ex, ey + 4, 7, 3, 0, 0, 2, 2);//spr(1,ex,ey);//enemy sprite
		}
		rectb(px - 20, py - 84, 100, 70, 12);
		rectb(px - 20, py - 10, 100, 45, 12);
		print("Spirit: " + ehp, ex, ey + 60, 12);
		if (player_party_size <= 1) {
			curr_player = 2;//player sprite
			spr(curr_player, px - 10, py - 70, 7, 4);//player sprites in battle
			power1 = "Strike"; //selected=0
			power2 = "Fireball"; //selected=1
			power3 = "Life Drain"; //selected=2
		}
		else if (player_party_size == 2) {
			curr_player = 6;
			spr(curr_player, px - 30, py - 85, 7, 4, 1, 0, 2, 2);//ghost
			power1 = "Hex"; //selected=0
			power2 = "Ill Will"; //selected=1
			power3 = "Vex"; //selected=2;
		}
		else if (player_party_size == 3) {//replace this with curr_player, to show current main party member 
			curr_player = 3;
			spr(curr_player, px - 30, py - 85, 7, 4, 1, 0, 2, 2);//skelly
			power1 = "";
			power2 = "";
			power3 = "";
		}
		else if (player_party_size == 4) {
			spr(38, px - 30, py - 85, 7, 4, 1, 0, 2, 2);//bat
			power1 = "";
			power2 = "";
			power3 = "";
		}
		/*	power1="";//bottom option - selected=0
			power2="";//middle option - selected=1
			power3="";//top option - selected= 2
		*/
		print("Spirit: " + php, 20, 95, 12);
		print("Potions: " + potions + "(X)", 20, 105, 12);
		print("Gold: " + gold, 20, 115, 12);
		print("Mana: " + mana, 20, 125, 12);
		if (pattack == true) {
			gold_msg = 0;
			if (selected == 0) {
				rect(px + 33, py - 32, 34, 7, 12);
				print(power1 + " (Z)", px + 35, py - 30, 13);
				rect(px + 33, py - 42, 34, 7, 15);
				print(power2, px + 35, py - 40, 14)
				rect(px + 33, py - 52, 34, 7, 15);
				print(power3, px + 35, py - 50, 14);
			}
			else if (selected == 1) {
				rect(px + 33, py - 32, 34, 7, 15);
				print(power1, px + 35, py - 30, 14);
				rect(px + 33, py - 42, 34, 7, 12);
				print(power2 + "  (Z)", px + 35, py - 40, 13);
				if (curr_player == 2 && mana > 0) {
					print("         -1 mana", px + 35, py - 32, 13);
				}
				else {
					rect(px + 33, py - 52, 34, 7, 15);
					print(power2 + " (No Mana)", px + 35, py - 40, 6)
				}
				rect(px + 33, py - 52, 34, 7, 15);
				print(power3, px + 35, py - 50, 14);
			}
			else if (selected == 2) {
				rect(px + 33, py - 32, 34, 7, 15);
				print(power1, px + 35, py - 30, 14);
				rect(px + 33, py - 42, 34, 7, 15);
				print(power2, px + 35, py - 40, 14)
				rect(px + 33, py - 52, 34, 7, 12);
				print(power3 + " (Z)", px + 35, py - 50, 13);
			}
		}
		//ai turn
		if (pattack == false && t > 300) {
			pattack = true;
			atk = -1;
		}
		else if (pattack == false) {
			//print damage box
			if (ehp <= 0 && gold_msg == 0) {
				gold_msg = Math.round(Math.random(5)) + 1;//rand gold
				if (gold_amt == 0) {
					gold_amt = gold_msg;
					gold += gold_amt;
				}
			}
			else if (ehp <= 0 && gold_msg > 0) {
				print("Gained " + gold_msg + " gold", ex - 20, ey + 90, 2);
			}
			if (t < 150 && pdmg > -1) {
				print("-" + pdmg + " dmg", ex - 20, ey - (t / 4), 12);
				if (ehp <= 0) {
					print("Enemy is defeated", ex, ey - 40, 12);
				}
			}
			else {
				if (ehp <= 0) {
					if (t > 120) {
						t = 0;
						//mset(Math.floor(x/8),Math.floor(y/8),32);//norm grass
						mset(Math.floor(((x + type_dirx) / 8) + mapoffsetx), Math.floor(((y + type_diry) / 8) + mapoffsety), 18);//gargoyle
						pattack = true;
						overworld = true;
					}
				}
				//ai damage to player
				if (atk == -1 && ehp > 0) {
					atk = Math.round(Math.random() * 2) + 1;
					if (atk != -1) {
						php -= atk;
					}
				}
				if (ehp > 0 && php > 0) {
					print("Enemy attacks for " + atk, px, py - 25 - (t / 4), 12);
					print("Enemy turn", px + 40, py + 40, 12);
				}
			}
			if (php <= 0) {//party size decreases
				msg = true;
				t = 301;
			}
		}
		t++
	}
	else if (intro == true) {
		cls();
		rectb(8, 8, 182, 112, 15);
		rect(9, 10, 178, 108, 0);
		print("STRIGOI", 82, 12, 12);
		spr(192, 50, 22, 7, 3, 0, 0, 4, 4);
		if (btnp(0) || btnp(1) || btnp(2) || btnp(3) || btnp(4) || btnp(5)) {
			intro = false;
			menu = true;
		}
	}
	else if (menu == true) {
		if (btnp(0) || btnp(1) || btnp(2) || btnp(3)) {
			menu_select += 1;
			if (menu_select > 1) {
				menu_select = 0;
			}
		}
		cls();
		rectb(8, 8, 182, 112, 15);
		rect(9, 10, 178, 108, 0);
		print("STRIGOI", 82, 12, 12);
		if (menu_select == 0) {
			print("Start", 87, 40, 12);
			print("Quit", 92, 60, 15);
			if (btnp(4) || btnp(5)) {
				menu = false;
			}
		}
		else {
			print("Start", 87, 40, 15);
			print("Quit", 92, 60, 12);
			if (btnp(4) || btnp(5)) {
				exit();
			}
		}
	}
	else if (overworld == true && msg == false) {
		m = 0;
		cls();
		if (change(x, y)) {
			map2 = true;
			mapoffsety = 16;
			mapoffsetx = 0;
			x = 2;
			y = 16;
		}
		if (map2 == true) {
			map(0, 16, 29, 31);
		}
		else {
			map();
		}
		////
		if (left == true) {
			spr(2, x, y, 5, 1, 1);//player sprite on map
		}
		else {
			spr(2, x, y, 5);//player sprite on map
		}
		print("hp: " + php + "  p: " + potions, 180, 1, 12);
	}
	else if (msg == true) {
		m += 1;
		cls();
		rectb(8, 8, 182, 112, 9);
		rect(10, 10, 178, 108, 14);
		if (msg_counter == 0 && php > 0) {//first msg
			print("Something has changed...", 25, 30, 12);
			print("Things that were dead stir...", 25, 50, 12);
		}
		else if (msg_counter == 1 && php > 0) {//2nd msg
			print("It's slowly coming back.", 20, 40, 12);
			print("There was a hideous monster.", 20, 60, 12);
			print("It came from the chapel.", 20, 80, 12);
			print("It left only carnage.", 20, 100, 12);
		}
		else if (msg_counter == 2 && php > 0) {//first msg
			print("I fled to the chapel...", 10, 40, 12);
			print("It was the one place it wasn't...", 10, 60, 12);
			print("That's when I found the book...", 10, 80, 12);
			print("I could feel the power flowing...", 10, 100, 12)
		}
		else if (msg_counter == 3 && php > 0) {//first msg
			print("With this magic, I can face it.", 10, 40, 12);
			print("Other things have risen too...", 10, 60, 12);
			print("I will learn and rid the world,", 10, 80, 12);
			print("of these risen monsters", 10, 90, 12)
		}
		else if (php <= 0 && player_party_size > 0) {
			print("Party member has died.", 20, 60, 12);
		}
		else if (php <= 0 && player_party_size <= 0) {
			print("Your efforts are in vein.", 20, 60, 12);
			print("As the life fades from you", 20, 80, 12);
			print("an evil creeps through your body", 14, 80, 12);
		}
	}
	if (m > 10) {//don't close while moving around
		if (btnp(0) || btnp(1) || btnp(2) || btnp(3) || btnp(4) || btnp(5)) {
			//	reset();
			m = 0;
			if (player_party_size <= 0 || enemy_party_size <= 0) {
				type = 0;//reset type
			}
			msg_counter += 1;
			msg = false;
			if (php <= 0) {//party size decreases
				player_party_size -= 1;
				if (player_party_size <= 0) {
					msg = true;
				}
				php = 2;
			}
		}
		if (player_party_size <= 0) {//end game
			reset();
		}
	}
}

